import { Button, Card, CardBody, CardImg, CardSubtitle, CardText, CardTitle } from "reactstrap";
import { IArticles } from "../types/news";

const Cards: React.FC<IArticles> = ({ author, content, desctription, publishedAt, source, title, url, urlToImage }) => {
  return (
    <Card>
      <CardImg alt="Card image cap" src="https://picsum.photos/318/180" top width="100%" />
      <CardBody>
        <CardTitle tag="h5">Card title</CardTitle>
        <CardSubtitle className="mb-2 text-muted" tag="h6">
          Card subtitle
        </CardSubtitle>
        <CardText>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</CardText>
        <Button>Button</Button>
      </CardBody>
    </Card>
  );
};

export default Cards;
